# Define the function to count Nucleotide Frequency in a string
def countNucFrequency(seq):
    tmpFreqDict = {"A":  0, "C": 0, "G": 0, "T": 0}
    for nuc in seq:
        tmpFreqDict[nuc] += 1
    return tmpFreqDict

# Example assign it a random DNA sequence
DNAString = ""
result = countNucFrequency(DNAString)
print(' '.join([str(val) for key, val in result.items()]))